The subnet owner has been very open that their reason for turning on emission burns is simply to “protect token value.”

But the results don’t really support this. During one month of ~90% burning, the token price fell nearly 100%. In contrast, in just one week of no burning, the price is already up ~50%. Can be coincidence tho. 

@CapriciousSage — in the novelty search you mentioned you’re against long-term burns unless there’s a strong justification (like an exploit or technical issue). Since you hold the majority stake here, it’s in your power to decide if this 75% long-term burn is acceptable. Could you please share whether you see the subnet owner’s reasoning as sufficient justification?

